import React from "react";
import { Link } from "react-router-dom";
import About from "../route/About";
import Home from "../route/Home";
import Products from "../route/Products";

const StyleNavbar = ()=>{
    return(
        <div>
            <Link to="/">    Home  </Link>
            <Home/>
            <About/>
            <Products/>
        </div>
    )
}

export default StyleNavbar
